import React from 'react';
import { Link } from 'react-router-dom';
import './landingPage.css';



export default function LandingPage() {
  const handleSubmit = (e) => {
    e.preventDefault();
    // Aquí puedes realizar la lógica de envío de datos si es necesario
    console.log('Formulario enviado');
  };

  return (
    <div>
      <h1>Iniciar Sesión</h1>
      <form onSubmit={handleSubmit}>
        <button type="submit" className="myButton">Iniciar Sesión</button>
      </form>
      <Link to="/videogames">
        <button className="myButton">ENTRAR</button>
      </Link>
    </div>
  );
}
